import React, {Component} from 'react';
import OverHeadBar from './OverHeadBar';
import Tshirt1 from '../assets/Tshirt1-square.jpg';
import merch from './MerchPage.module.css';
import {ClickDetailButton} from "../Component/ClickButton";


function goodsTile(props) {
    return(
        <div className={merch.tile}>
            <img className={merch.pic} src={props.name} alt={props.name}/>
            <p>{props.description}</p>
            <p>{props.price}</p>
            <ClickDetailButton path='tshirt1' name='DETAILS'/>
        </div>
    )
}

function MerchPage(props){
    return (
        <div>
            <OverHeadBar currentPage='SHOP'/>
            <div className={merch.overview}>
                goodsTile
            </div>
        </div>
    );
}


export default MerchPage;
